import React from 'react'
import {Spin} from 'antd'
import {Container} from './Container'

const Loading: React.FC = () => {
    return (
        <Container style={{position: 'static', bottom: 0, top: 0}}>
            <Spin size="large" />
        </Container>
    )
}

export default Loading
